INSERT INTO `recommendations` VALUES (11,'getting plenty of rest','Temperature','Home'),(12,'Drink water and juices to stay hydrated','Temperature','Home'),(13,'Wear comfortable, loose clothes','Temperature','Home'),(14,'Keep your place at a cool, comfortable temperature','Temperature','Home'),(15,'Recognize the signs of hypothermia','Temperature','Home'),(16,'Get out of the cold. If your body temperature is dropping dramatically, you need to get out of the cold. If you are outdoors, find a warm room or shelter','Temperature','Home'),(17,'Remove wet clothes. If your clothes are wet, then remove them and put on some dry clothes','Temperature','Home'),(18,'Rely on skin-to-skin contact. If you can\'t get indoors, curl up with another person under loose, dry layers of blankets or clothing','Temperature','Home'),(19,'Warm the center of the body first','Temperature','Home'),(20,'Deep breathing: Breathing in deeply through the abdomen can help someone manage their breathlessness','Respiration','Home'),(21,'Pursed lip breathing: helps reduce breathlessness by slowing the pace of a person’s breathing','Respiration','Home'),(22,'Finding a comfortable and supported position','Respiration','Home'),(23,'Using a fan: using a handheld fan to blow air across the nose and face could reduce the sensation of breathlessness','Respiration','Home'),(24,'Inhale steam: help keep a person’s nasal passages clear, which can help them breathe more easily','Respiration','Home'),(25,'Drinking black coffee: help ease breathlessness, as the caffeine in it can reduce tightness in the muscles in a person’s airway','Respiration','Home'),(26,'Eating fresh ginger: Eating fresh ginger, or adding some to hot water as a drink, may help reduce shortness of breath that occurs due to a respiratory infection','Respiration','Home'),(27,'Breathe through pursed lips','Respiration','Home'),(28,'Breathe slowly into a paper bag or cupped hands','Respiration','Home'),(29,'ttempt to breathe into your belly (diaphragm) rather than your chest','Respiration','Home'),(30,'Hold your breath for 10 to 15 seconds at a time','Respiration','Home'),(31,'Manage your stress through relaxation','Heart','Home'),(32,'Drink enough water','Heart','Home'),(33,'Avoid stimulants like tobacco products, heavy alcohol','Heart','Home'),(34,'Eat a banalanced diet','Heart','Home'),(35,'Exercise regularly','Heart','Home'),(36,'Eat Cayenne pepper: It is a natural blood regulator and a heart tonic. It also helps remove congestion in the circulatory system as well as stimulate the body','Heart','Home'),(37,'at Ginger: The stimulant properties that a ginger contains are quite similar to that of a cayenne pepper','Heart','Home'),(38,'Stress Reduction: You can reduce stress by meditating, having excellent sleep patterns, and engaging in physical activity','Heart','Home'),(39,'Garlic contains natural properties that enable it to reduce body cholesterol, high blood pressure, and improve coronary heart diseases','Heart','Home'),(40,'Lie down in the prone position. Proning is the best position to increase the oxygen level of your body','Spo2','Home'),(41,'Include more antioxidants in your diet. Antioxidants allow your body to use oxygen more efficiently','Heart','Home'),(42,'Drink lots of fluid. Keeping yourself hydrated is another important method to improve your blood\'s oxygen saturation level','Spo2','Home'),(43,'Cold foot bath. Placing your feet in a cold foot bath cools your body and allows you to sit back','Temperature','Home'),(44,'Gently press two fingers (don\'t use your thumb) on the spot until you feel a beat','Heart','Home'),(45,'Investigation must be done example Full blood picture','Temperature','Hospital'),(46,'investigation must be done example Full blood picture, urine test, malaria test','Temperature','Hospital'),(47,'Vagal maneuvers','Heart','Hospital'),(48,'Medications : if vagal maneuvers don\'t stop the fast heartbeat medication  may be needed','Heart','Hospital'),(49,'Cardioversion : if Vagal maneuvers and medication don\'t work, it\'s also possible cardioversion with medication','Heart','Hospital'),(50,'Paracetamol suppository','Temperature','Hospital'),(51,'Injection of paracetamol','Temperature','Hospital'),(52,'Cover the patient with blanket or clothing','Temperature','Hospital'),(53,'Prescription of  medication','Heart','Hospital'),(54,'Investigation must be done to find underlying cause','Heart','Hospital'),(55,'supplemental of oxygen','Spo2','Hospital'),(56,'Give fluid to the patient','Heart','Hospital'),(57,'take ECG','Heart','Hospital');
